INSERT INTO `module` VALUES (0,'Praxissemester','Die Studierenden kennen Arbeitsumgebungen aus der Praxis, haben Erfahrungen mit tagtäglichen Aufgabenstellungen und kennen Möglichkeiten zur Lösungsfindung und die Präsentation von Ergebnissen',30,7),(8998,'Bachelorarbeit','Die Studierenden können selbständig eine Aufgabenstellung bearbeiten. Sie sind in der Lage, nach entsprechender Literatur zu recherchieren, Lösungsansätze zu entwickeln und die Ergebnisse zu dokumentieren',12,6),(8999,'Bachelor-Kolloquium','Die Studierenden sind in der Lage, ihre Bachelor-Projektarbeit kompetent zu verteidigen und die Entstehungs- und Entscheidungsprozesse während der Entwurfsarbeit nachvollziehbar darzustellen',3,6),(9998,'Masterarbeit','Die Studierenden behandeln selbständig eine Aufgabenstellung. Sie werden dabei im Rahmen von einem Professor des Fachbereichs betreut.',27,9),(9999,'Masterkolloquium','Die Studierenden tragen über Ihre Masterarbeit vor. Sie stellen die Problemstellung vor und legen den Lösungsweg und die Ergebnisse dar. Auf Fragen über die Arbeit und angrenzende Fachgebiet müssen Sie antworten.',3,9),(51101,'Höhere Mathematik 1','In diesem Fach werden fortgeschrittene mathematische Methoden erlernt',8,1),(51104,'Grundlagen der Informatik und höhere Programmiersprache für Informatik','Hier wird Programmieren erlernt (Schleifen, Pointer und co.)',11,1),(52105,'Technische Informatik','Mikrocontroller, Assembler, Einsen und Nullen',8,1),(52106,'Algorithmen und Datenstrukturen','Fortgeschrittene Programmierung, Bäume, Listen, Suchalgorithmen, Graphen',8,2),(52108,'Höhere Mathematik 2 für Informatik','Algorithmen softwaregemäß umsetzen und anwenden',6,2),(52110,'Datennetze und IT-Sicherheit','Kommunikationsschichten des Internet im Top-Down-Approach kennenlernen',8,2),(53105,'Theoretische Informatik und Logik','Wissenschaftlichen Grundlagen der Logik und der Modellierung durch Automaten und Grammatiken beherrschen',8,2),(53106,'Datenbanken und Webtechnologien','Verständnis für die Bedeutung und Architektur von Datenbankmanagementsystemen',8,3),(53107,'Architektur von Rechnersystemen, Betriebssystemkonzepte und verteilte Systeme','Komponenten und Konzepte von Betriebssystemen verstehen und  Programme in Assembler entwickeln, testen und bewerten',8,3),(53111,'Objektorientierte Softwareentwicklung','Erlernen der Konzepte und Methoden der Objektorientierten Softwareentwicklung und den Einsatz dieser, zum Modellieren, Entwerfen, Implementieren und Testen',5,3),(54107,'Mikrocontrollersysteme','Studierende sind in der Lage, Mikrocontrollersysteme je nach den gegebenen Anforderung auszuwählen, zu konfigurieren und zu programmieren',6,4),(54117,'Fahrzeugsoftware','Die Studierenden lernen typische Softwarearchitekturen automobiler Steuergeräte auf unterschiedlichen Ebenen kennen und eigenständig zu programmieren',6,4),(55107,'Software Engineering','Modelle und Methoden des Softwareprozesses kennenlernen und Fähigkeit erwerben, Komponenten des SWE in das soziotechnische System einzuordnen und die Auswirkungen von dessen Komplexität zu beurteilen',5,3),(55301,'BWL für Ingenieure','Vermitteln der funktional orientierten Sicht der Betriebswirtschaftslehre',4,3),(55601,'Mikrocontroller basierte Systeme in der Automatisierungstechnik','Teilnehmer erwerben die praktische Fähigkeit und die theoretischen Grundlagen zur Entwicklung eines Mikrocontroller-Systems mit Software und peripherer Hardware',6,4),(55603,'SPS-Programmierung','Nicht vorhanden',6,5),(55606,'Datenkompression','Kenntnis der Ziele und Bewertung von Datenkompression, der Algorithmen zur verlustlosen und verlustbehafteten Kompression und der wichtigsten Anwendungen der Datenkompression',6,4),(55607,'Bildverarbeitung','Neben der Bildverbesserung werden die notwendigen Segmentierungs- und Klassifikationstechniken zur Erkennung von verschiedenen Objekten in den Bilddaten erlernt und erhält die Fähigkeit Lösungen zur Bildanalyse selbständig zu entwickeln',6,5),(55611,'Angewandte Wahrscheinlichkeitsrechnung','Studenten/innen können Zufallsexperimente interpretieren, modellieren und auswerten und können bei statistischen Analysen geeignete Werkzeuge heranziehen',6,4),(55615,'Geräte und Anlagen der Automatisierungstechnik','Studenten/innen erlernen Automatisierungssysteme und synthetisieren binäre und digitale Systeme zur Realisierung automatisierter Anlagen und Verfahren',6,4),(55619,'Kryptologie','Kennenlernen der Grundlagen, Methoden und Möglichkeiten von historischen und modernen Verschlüsselungsverfahren (symmetrische- und asymmetrische Verschlüsselung)',6,5),(55623,'Angewandte Mathematik','Erlernen, Problemstellungen mathematisch/numerisch zu analysieren, Lösungsalgorithmen auszuwählen, zu beurteilen und ein lauffähiges, hoch-performantes Computerprogramm zu entwickeln und zu implementieren',6,4),(55636,'Web Application Security','IT-Sicherheitsprobleme von Webseiten, Webanwendungen und Web Services kennenlernen und erlernen angemessener und wirksamer Gegenmaßnahmen zum Schutz solcher Dienste und Anwendungen',6,5),(55638,'Digital Analytics','Studenten/innen lernen die Definition, die Historie, den Zusammenspiel verschiedener Disziplinen und die Abgrenzung zu anderen Bereichen kennen',6,5),(55639,'Wissensrepräsentation und High-Level Control','Techniken zur logik-basierten Wissensrepräsentation und zugehörige Verfahren des logischen Schließens für die Ausarbeitung spezifischer Methoden für die High-Level-Steuerung von Agenten',6,5),(55640,'Grundlagen der Elektrotechnik','Die Studierenden lernen Gleich- und Wechselstromnetzwerke kennen und können sie mittels verschiedener Netzwerk-Analyseverfahren berechnen und können Filterschaltungen berechnen und mittels Bodediagrammen veranschaulichen',6,4),(55641,'Big Data Analytics I','Die Studierenden lernen die Prinzipien, Architekturen, Datenstrukturen und fundamentalen Algorithmen der Datenanalyse großer Datenmengen und sind in der Lage, einfache Datenanalyseprojekte',6,4),(55642,'Big Data Analytics II','Die Studierenden lernen Techniken und Anwendungen der Datenanalyse kennen, um in der Lage zu sein für einen konkreten Anwendungsfall geeigneten Techniken auszuwählen und anzuwenden',6,5),(55643,'Einführung in die Künstliche Intelligenz 2','Dieses Modul vertieft die Inhalte, die im Modul \"Einführung in die Künstliche Intelligenz\" gelehrt werden',6,5),(55650,'Informationstheorie','Grundlagen der Shannons Informations- und Codierungstheorie und Vertrautheit mit den Verfahren der Datenkompression und  Methoden zur Codierung, Korrektur und Erkennung von Bitfehlern',6,4),(55651,'Software Ergonomie','Erlernen, wie die Wahrnehmung und Informationsverarbeitung des Menschen funktioniert, was der Mensch kann und wo die Grenzen seiner Fähigkeiten liegen und co.',6,5),(55654,'Service Management mit ServiceNow','Modelle und Methoden kennenlernen zur Entwicklung von digitalen Services mit ServiceNow als Entwicklungsplattform und Prozesse kennenlernen zur Unterstützung und zum Betrieb',6,4),(55656,'Compilerbau','Teilnehmer erwerben Verständnis fürzentrale Konzepte des Compilerbaus und sind befähigt, diese zur Implementierung eines eigenen Compilers anzuwenden und in einem größeren Kontext einzuordnen',6,5),(55657,'Computergrafik','Verständnis der mathematischen Verfahren und der Algorithmen, die zur Erzeugung von Grafiken in der Computergrafik eingesetzt werden und die Studierenden sollen in der Lage sein, Computergrafiken zu programmieren',6,4),(55660,'IT-Forensik','Grundlagen, Methoden und Möglichkeiten der IT Forensik,  Analysemethoden für verschiedene Dateisysteme und  juristische Aspekte und dem Umgang mit Beweismitteln kennenlernen',6,4),(55664,'IT Service Management','Die Vorlesung gibt einen Überblick über die IT Service Prozesse gemäß ITIL Version 2011, ISO 20000 und FitSM',6,4),(55665,'Einführung in die Künstliche Intelligenz','Erlernen von \"Suchverfahren\", \"Wissensrepräsentation\", \"Planverfahren\" und \"Maschinelles Lernen\" und Vertiefung der Bereiche Algorithmik, Logik und Lerntheorie',6,4),(55667,'Kommunikationstechniken','Präsentationen halten',2,1),(55668,'Wissenschaftliches Arbeiten','Die Studierenden lernen die wesentlichen Aspekte zu Aufbau und formalen Anforderungen wissenschaftlicher Arbeiten kennen',2,1),(55669,'Tutorenarbeit','Lernen, mit Studierenden der ersten Semester zu kommunizieren und Ihnen als studentischer/e Mentor/in zur Seite zu stehen',2,1),(55670,'studentische Projekte','Studenden/innen lernen, ihre im bisherigen Studium erlangten Kenntnisse in einem großen Projekt anzuwenden und in Projektteams zu arbeiten',2,1),(55671,'Training allgemeiner Kompetenzen','Erlernen, die Kommunikation mit internationalen Komilitonen und Dozenten und Projekte erfolgreich durchzuführen',2,1),(55672,'Gremientätigkeit','Lernen, in der Entwicklung und Verbesserung aktueller Studiengänge mitzuarbeiten und zur Lösung von Konflikten beizutragen',2,1),(55678,'Development for Operations','Software-Versionskontrolle, Erstellung einheitlicher IT-Umgebungen für Entwicklung und Produktivbetrieb, Container-Virtualisierung, Continuous Integration oder Configuration Management können erklärt und in konkreten Szenarien angewendet werden',6,4),(55679,'Fehlertolerante Systeme','Die Studierenden verstehen die Architektur und Funktionsweise verschiedener aktueller Hochverfügbarkeitsmechanismen für IT Systeme und können diese analysieren, modellieren und erstellen',6,5),(55680,'Grundlagen der Medieninformatik','Sie verstehen die Zusammenhänge und Bezüge zur Informations- und Kommunikationstechnologie, sowie die technische und wirtschaftliche Bedeutung der Medieninformatik in der Digitalen Wirtschaft',6,4),(55682,'IT-Infrastruktur','Konzepte der IT-Infrastrukturen wie z.B. Client-Server Architektur und Verzeichnisdienste können erklärt und in Szenarien angewendet werden und Verständnis des Aufbaus und der Funktionsweise der IT-Infrastruktur-Architekturen wird erlangt',6,4),(55683,'IT-Sicherheit 2','Die Teilnehmer lernen aufbauend auf dem Modul Datennetze und IT-Sicherheit einerseits (technische) Gefährdungen für die IT-Sicherheit in Unternehmen kennen, andererseits erlernen sie angemessene und wirksame Gegenmaßnahmen',6,5),(55684,'Informationssicherheitsmanagement','Die Teilnehmer lernen aufbauend auf dem Modul Datennetze und IT-Sicherheit verschiedene Standards, Best Practices und Prozesse zum Management von Informationssicherheit und den damit verbundenen Aufgaben in Unternehmen kennen',6,5),(55685,'Konzepte moderner Programmiersprachen','Teilnehmer sind befähigt, ausgehend von Anforderungen die richtigen Entscheidungen über die geeigneten Programmiersprachen und Sprachkonstrukte zur Umsetzung der Anforderungen zu treffen',6,5),(55686,'Robotik','Die Studierenden erlernen grundlegende Methoden zur Lösung fundamentaler Probleme mobiler Roboter',6,5),(55689,'Verteilte Systeme 2','Nicht vorhanden',6,4),(55690,'Virtual Reality / Augmented Reality','Die Studierenden sind in der Lage Virtual Reality (VR) und Augmented Reality (AR) - Systeme zu analysieren und zu evaluieren und kennen die verschiedenen Technologien und deren Probleme',6,5),(55693,'Technisches Englisch','Verbesserung des Lese- und Hörverständnisses und der schriftlichen und mündlichen Verständigung im technischen Englisch',2,1),(55695,'Lern- und Selbstmanagement','Vermitteln von Theorien und Hypothesen zur Optimierung des Zeitmanagements, Selbstmanagements und das Erlernen von konkreten Lerntheorien und –methoden',2,1),(55697,'Erstellung von Digests zu wirtschaftsinformatischen Themen','Nicht vorhanden',2,2),(55698,'Mein Einstieg in die Berufswelt','Studenten sollen in der Lage sein, bisher unkalkulierbare und neue Situationen im Arbeitsalltag, die nicht oder nur bedingt mit dem eigentlichen Arbeitsinhalt zu tun haben, dennoch die Arbeit und das Arbeitsklima beeinflussen, einordnen zu können',2,1),(55711,'User Centered Project Management','Ziel der Vorlesung sowie der begleitenden Praktika ist es, Studierenden nahezubringen, innovative interaktive Systeme von hoher User Experience unter Anwendung von etablierten Management und Engineering Methoden zu entwickeln',6,4),(55713,'Change Management','Damit Changes erfolgreich umgesetzt werden können, werden Modelle, Theorien und Methoden des Change Managements werden vorgestellt und Studierende lernen, wie die richtigen Methoden in den passenden Situationen eingesetzt werden',6,4),(55746,'Digitalisierung und Innovation','Ziel dieses Kurses ist es, die Disruption der Digitalisierung für die Industrie zu verstehen',6,5),(55756,'Medienproduktion','Verfügen über Theorie-, Fakten- und Methodenwissen im Bereich der Medientechnik und der Medienproduktion und verstehen die Organisation, Abläufe, Prozesse, und die verwendete Technik',6,4),(55757,'Blended Commerce','Studierende sollen in der Lage sein, Blended Commerce Konzepte zu entwickeln, zu bewerten und prototypisch in interaktive Lösungen umzusetzen',6,4),(55760,'Geschäftsprozessmanagement','Die Studierenden sind in der Lage, selbstständig Geschäftsprozesse zu modellieren, zu implementieren und auszuführen (BPMN, CMN, DMN)',6,5),(55762,'Mediensicherheit und -forensik','Verfügen über grundlegendes Theorie-, Fakten- und Methodenwissen und Verständnis auf dem Themengebiet der Mediensicherheit und Medienforensik und verstehen den Nutzen der Anwendung von Schutz- und Verschlüsselungsverfahren für Mediendaten',6,4),(55763,'Medienkompression und -übertragung','Verfügen über Theorie-, Fakten- und Methodenwissen im Bereich der Kompression der Mutlimediadaten und können grundlegende Algorithmen und Konzepte der Medienkompression in MATLAB programmieren',6,4),(55768,'Führen im IT-Umfeld','Lernen, was man als IT-Führungskraft einfach wissen muss, welche Managementmethoden funktionieren und welche nicht und Aneignung eines Management-Toolsets',6,4),(55771,'Requirements Engineering','Sie sind in der Lage, Anforderungen zu erheben, adressatengerecht zu dokumentieren und managen. Sie verfügen über das dazu notwendige Methodenwisssen und über praktische Erfahrungen bei der Umsetzung',6,4),(56101,'Praxisprojekt','Die Studierenden können unter Anleitung Probleme aus der Praxis bearbeiten und lösen und Erlernen Fähigkeiten wie Arbeitsorganisation, Arbeitsaufteilung und - absprachen im Team, Dokumentation und Präsentation von Ergebnissen',15,6),(552011,'Dashboard zur Prozesslandschaft des FB 05','Es soll ein Dashboard entwickelt werden, das mindestens eine Darstellung und Beschreibung der Prozesse des FBs liefert, aber auch zur Digitalisierung der Prozesse des Fachbereiches beiträgt',6,5),(552012,'Integration von Radar-Sensor Daten in OpenStreetMap','Es soll eine eine mobile Plattform mit einer interaktiven Software zu realisieren, die gemessene Daten direkt als Reflexionspunkte in eine Umgebungskarte projiziert',6,5),(552013,'Automatisierte Erkennung von biometrischen Parametern mit Machine Learning basierten Algorithmen','Im Rahmen dieses Projektes soll ein Software-Tool entwickelt werden, das mit einer Videokamera Bilder von Personen aufnimmt und analysiert. Dabei sollen automatisch biometrische Parameter wie Alter, Geschlecht, Augenfarbe erkannt bzw. geschätzt werden',6,5),(552014,'Entwicklung eines integrierten Marketing-Kommunikationskonzeptes visuell/verbal','Es werden integrierte Kommunikationskonzepte entwickelt (sämtliche Bereiche der visuellen und verbalen Kommunikation unter Berücksichtigung medienspezifischer und zielgruppenspezifischer Analyseergebnisse)',6,5),(552015,'Nutzung von Technologie zur Vernetzung von Menschen und zur Stärkung des gesellschaftlichen Zusammen','Ziel des Projektes ist, eine Plattform zu etablieren, mit deren Hilfe Menschen bedeutsame Begegnungen erleben und Gespräche miteinander führen können',6,5),(552016,'Autonomous Driving Platform','Ziel dieses interdisziplinären Projekts ist es eine derartige Softwareplattform auf Basis von Polysync Core weiterzuentwickeln und erste prototypische Implementierungen vorzunehmen',6,5),(552017,'Sprachdienste mit Alexa und Co.','Im Rahmen des IP soll daran gearbeitet werden, wie man methodisch fundiert Dienstleistungen rund um die gängigen Sprachplattformen Alexa und Google Assistant aufbauen kann',6,5),(552018,'Videoanalyse für den Sport','In diesem Projekt sollen Techniken zur Objektsegmentierung aus Videodaten untersucht werden. Dazu werden Algorithmen der Bildverarbeitung genutzt',6,5),(552019,'Entwicklung einer App Typ „Studiengangs-Tinder“, die Schülerinnen und Schülern spielerisch bei der S','Eine Studienwahlapp des Typs Tinder soll die entstehende Lücke füllen',6,5),(5520110,'Bild- und Video-Forensik: Automatische Detektion von manipulierten Bildern','In diesem Projekt soll ein bestehendes und an der FH entwickeltes Software-Tool weiterentwickelt werden, das Videodaten einliest und medienforensisch analysiert, und damit Manipulationen sichtbar machen kann',6,5),(5520111,'Fahrzeugdatenmanagement','Ziel dieses interdisziplinären Projekts ist es Geschäftsmodelle für die kommerzielle Nutzung derartiger Datenerfassungs- und Auswertungssysteme zu entwickeln und in Modellrechnungen zu kalkulieren',6,5),(5520112,'Digitalisierung im Sport','Der Ansatz für die digitale Transformation von Sportvereinen, Betriebssportgruppen und anderer Trainingsgruppen soll weitergedacht und erweitert werden',6,5),(5520113,'Medical VR/AR-Apps','In diesem Projekt sollen MRT- und CT-Datensätze mittels VR/AR-Ansätzen visualisiert und registriert werden',6,5);
